function safeString(mod) {
    return mod.replace('+', '_plus_').replace('-', '_minus')
}


class Cigar {

    operators = new Set(['M', 'D', 'I', 'S', 'H', '=', 'X'])

    constructor(cigar) {
        this.cigar = cigar
    }

    nextOperator() {
        for (let i = 0; i < this.cigar.length; i++) {
            const c = this.cigar.charAt(i)
            if (this.operators.has(c)) {
                const n = Number.parseInt(this.cigar.substring(0, i))
                if (i + 1 < this.cigar.length) {
                    this.cigar = this.cigar.substring(i + 1)
                } else {
                    this.cigar = ""
                }
                return {
                    n: n,
                    op: c
                }
            }
        }
    }
}


